import React from "react";

function Input({ className, id, name, type, placeholder, onChange }) {
    return(
        <input
                    className={className}
                    id={id}
                    type={type}
                    name={name}
                    placeholder={placeholder}
                    required
                    onChange={onChange}
                />
    )
}

export default Input;
